INSERT INTO tarmed_extension VALUES ('00.0010-20010101','','Beinhaltet alle ärztlichen Leistungen, die der Facharzt in seiner Praxis oder der Arzt bei ambulanten Patienten im Spital ohne oder mit einfachen Hilfsmitteln (etwa Inhalt Besuchskoffer) am Patienten hinsichtlich der Beschwerden und Erscheinungen erbringt, derentwegen dieser zum Facharzt kommt, bzw. gebracht wird und hinsichtlich der Beschwerden und Erscheinungen, die während der gleichen Behandlungsdauer auftreten.\r\n\r\nBeinhaltet Begrüssung, Verabschiedung, nicht besonders tarifierte Besprechungen und Untersuchungen, nicht besonders tarifierte Verrichtungen (z.B.: bestimmte Injektionen, Verbände usw.), Begleitung zu und Übergabe (inkl. Anordnungen) an Hilfspersonal betreffend Administration, technische und kurative Leistungen, Medikamentenabgabe (in Notfallsituation u/o als Starterabgabe), auf Konsultation bezogene unmittelbar vorgängige/anschliessende Akteneinsicht/Akteneinträge.','');
INSERT INTO tarmed_extension VALUES ('00.0020-20010101', '', NULL, NULL); 
INSERT INTO tarmed_extension VALUES ('00.0140-20010101', '', 'Gilt für alle ärztlichen Leistungen zur Behandlung des Patienten in dessen Abwesenheit (ausgenommen telefonische Konsultation), die notwendigerweise durch den Facharzt mündlich oder telefonisch erfolgen müssen, z.B. Erkundigungen bei Dritten, Auskunft an Angehörige oder andere Bezugspersonen des Patienten, Besprechung mit Therapeuten und Betreuern, Überweisung an Konsiliarärzte, Ausstellen von Rezepten oder Verordnungen ausserhalb von Konsultation, Besuch und telefonischer Konsultation. 
INSERT INTO tarmed_extension VALUES ('00.0510-20010101', '', 'Gilt insbesondere für:
INSERT INTO tarmed_extension VALUES ('00.0750-20010101','','Nur verrechenbar, falls die Injektion oder die Infusion nicht im Rahmen einer ärztlichen Beratung erfolgt.\r\n\r\nInkl. Infusionswechsel.','');
